  input: TEXT,"F3A","","In response to FEC letter dated, 7 March 2003, item 1, the
    $1,000 contribution from Lois Mattern, as reported in the 48 hour notice dated
    9/4/02, was inadvertently attributed to Richard Mattern. This amendment properly
    attributes the contribution to Lois Mattern, who is Richard Mattern's wife. In
    response to FEC letter dated, 7 March 2003, item 2, due to a clerical error, the
    items in question had dates of receipt improperly recorded. This amendment properly
    records the correct date of receipt of the items in question and clarifies that
    these items in question were received after the close of the 48 hour reporting
    period. This amendment properly records the amount of an in-kind contribution
    received on 27 August 2002 from the National Committee for an Effective Congress.
    The improper recording of the amount of the National Committee for an Effective
    Congress in-kind contribution was due to a clerical error. If you have any further
    questions, please do not hesitate to contact me at 845-338-8890. Thank you for
    your attention to these matters."
